import React from 'react';
import { Link } from 'react-router-dom';

function NoMatchPage(props) {
  return(
    <div className='noMatch'>
      <h1>404 Page Not Found</h1>
      <Link to={{pathname:"/projects",activeCategory:'all'}} className={`similarProjects ${currentSlide===props.slides.length-1 ? 'slideUp':'slideDown'}`}><span>{`${props.about?'See My Work':'Similar Work'}`}</span></Link>

    </div>
  )
}

export default NoMatchPage;
